import InputBase from '@material-ui/core/InputBase';
import SearchIcon from '@material-ui/icons/Search';

export default class NavBar extends Component {
  render() {
    return (
      <div id="Nav-Bar">
        <AppBar position="static">
          <Toolbar>
            <Typography variant="h6" >
              News
            </Typography>
          </Toolbar>
        </AppBar>
      </div>
    );
  }
}
